import{_ as a}from"./chunks/position_fixed.t2m3lWVy.js";import{_ as t,c as i,a8 as l,o as r}from"./chunks/framework.BDnHobkS.js";const C=JSON.parse('{"title":"Режим посадки (Мультикоптер)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_modes_mc/land.md","filePath":"uk/flight_modes_mc/land.md"}'),o={name:"uk/flight_modes_mc/land.md"};function d(n,e,_,h,m,s){return r(),i("div",null,e[0]||(e[0]=[l('<h1 id="режим-посадки-мультикоптер" tabindex="-1">Режим посадки (Мультикоптер) <a class="header-anchor" href="#режим-посадки-мультикоптер" aria-label="Permalink to &quot;Режим посадки (Мультикоптер)&quot;">​</a></h1><img src="'+a+'" title="Position estimate required (e.g. GPS)" width="30px"><p>Режим польоту Посадка змушує транспортний засіб сідати на місці, де був увімкнений цей режим. Транспортний засіб роззброїться незабаром після посадки (за замовчуванням).</p><div class="info custom-block"><p class="custom-block-title">INFO</p><ul><li>Режим автоматичний - для керування апаратом не потрібно втручання користувача.</li><li>Режим потребує принаймні дійсної локальної оцінки позиції (не потребує глобальної позиції). <ul><li>Літаючі транспортні засоби не можуть переключатися на цей режим без глобального положення.</li><li>Літаючі транспортні засоби перейдуть в режим аварійної безпеки, якщо втратять оцінку положення.</li></ul></li><li>Режим перешкоджає зброюванню (транспортний засіб повинен бути зброєний при переході на цей режим).</li><li>Перемикачі керування RC можуть використовуватися для зміни режимів польоту на будь-якому транспортному засобі.</li><li>RC stick movement in a multicopter (or VTOL in multicopter mode) will <a href="#COM_RC_OVERRIDE">by default</a> change the vehicle to <a href="./../flight_modes_mc/position.html">Position mode</a> unless handling a critical battery failsafe.</li><li>The mode can be triggered using the <a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_LAND" target="_blank" rel="noreferrer">MAV_CMD_NAV_LAND</a> MAVLink command, or by explicitly switching to Land mode.</li></ul></div><h2 id="технічнии-підсумок" tabindex="-1">Технічний підсумок <a class="header-anchor" href="#технічнии-підсумок" aria-label="Permalink to &quot;Технічний підсумок&quot;">​</a></h2><p>Транспортний засіб приземлиться в місці, в якому був активований режим. The vehicle descends at the rate specified in <a href="#MPC_LAND_SPEED">MPC_LAND_SPEED</a> and will disarm after landing (by <a href="#COM_DISARM_LAND">default</a>).</p><p>RC stick movement will change the vehicle to <a href="./../flight_modes_mc/position.html">Position mode</a> (by <a href="#COM_RC_OVERRIDE">default</a>).</p><h3 id="параметри" tabindex="-1">Параметри <a class="header-anchor" href="#параметри" aria-label="Permalink to &quot;Параметри&quot;">​</a></h3><p>Поведінку режиму приземлення можна налаштувати за допомогою наведених нижче параметрів.</p><table tabindex="0"><thead><tr><th>Параметр</th><th>Опис</th></tr></thead><tbody><tr><td><a id="MPC_LAND_SPEED"></a><a href="./../advanced_config/parameter_reference.html#MPC_LAND_SPEED">MPC_LAND_SPEED</a></td><td>Швидкість спуску під час посадки. Це повинно бути тримано досить низько, оскільки ґрунтові умови не відомі.</td></tr><tr><td><a id="COM_DISARM_LAND"></a><a href="./../advanced_config/parameter_reference.html#COM_DISARM_LAND">COM_DISARM_LAND</a></td><td>Тайм-аут для автоматичного роззброєння після посадки, у секундах. Якщо встановлено на -1, транспортний засіб не роззброюється при посадці.</td></tr><tr><td><a id="COM_RC_OVERRIDE"></a><a href="./../advanced_config/parameter_reference.html#COM_RC_OVERRIDE">COM_RC_OVERRIDE</a></td><td>Controls whether stick movement on a multicopter (or VTOL in MC mode) causes a mode change to <a href="./../flight_modes_mc/position.html">Position mode</a>. Це можна окремо увімкнути для автоматичних режимів та для режиму поза бортом, і в автоматичних режимах воно включено за замовчуванням.</td></tr><tr><td><a id="COM_RC_STICK_OV"></a><a href="./../advanced_config/parameter_reference.html#COM_RC_STICK_OV">COM_RC_STICK_OV</a></td><td>Кількість рухів стиків, яка викликає перехід у <a href="./../flight_modes_mc/position.html">режим Положення</a> (якщо <a href="#COM_RC_OVERRIDE">COM_RC_OVERRIDE</a> увімкнено).</td></tr></tbody></table><h2 id="дивіться-також" tabindex="-1">Дивіться також <a class="header-anchor" href="#дивіться-також" aria-label="Permalink to &quot;Дивіться також&quot;">​</a></h2><ul><li><a href="./../flight_modes_fw/land.html">Режим посадки (FW)</a></li><li><a href="./../flight_modes_vtol/land.html">Land Mode (VTOL)</a></li></ul>',12)]))}const p=t(o,[["render",d]]);export{C as __pageData,p as default};
